import {
  BellOutlined,
  CalendarOutlined,
  OrderedListOutlined,
  PieChartOutlined,
  UserOutlined,
} from "@ant-design/icons";
import { Col, Drawer } from "antd";

export const SideBar = () => {
  return (
    <div>
      <aside style={{}}>
        <Drawer
          className="side-bar"
          placement={"left"}
          closable={false}
          open={true}
          style={{
            position: "absolute",
            left: "5%",
            height: "100%",
            width: "60px",
            borderRadius: "50px 50px",
          }}
        >
          <Col
            style={{
              display: "flex",
              flexDirection: "column",
              justifyContent: "space-evenly",
              rowGap: "40px",
            }}
          >
            <OrderedListOutlined />
            <UserOutlined />
            <PieChartOutlined />
            <BellOutlined />
            <CalendarOutlined />
          </Col>
        </Drawer>
      </aside>
    </div>
  );
};
